const Skills = () => {
  return (
    <div id="skills">
      <div className="hd underline underline-offset-8 decoration-4 lg:ml-64 decoration-yellow-400">
        <h4 className="font-bold ml-6 text-lg ">TECHS</h4>
      </div>
      <div>
        <ul className="lg:ml-64">
          <h3>Languages</h3>
          <li></li>
        </ul>
      </div>
    </div>
  );
};
export default Skills;
